            <div id="HEADLINE301" class='ladi-element'><h3 class='ladi-headline ladi-transition'>SEO là gì?<br></h3>
            </div>
            <div id="HEADLINE302" class='ladi-element'><h3 class='ladi-headline ladi-transition'>SEO là viết tắt của cụm
                    từ Search Engine Optimization – Tối ưu hóa công cụ tìm kiếm. Về bản chất, SEO là thực hiện các hoạt
                    động để tối ưu website về nội dung, cấu trúc, giao diện, hệ thống liên kết nội bộ và bên ngoài,
                    quảng bá nội dung trên nhiều nền tảng xã hội, kênh báo chí.&nbsp;<br>Mục tiêu đầu tiên của SEO là
                    phục vụ bộ máy tìm kiếm (Google, Bing, Yandex,…) nhanh chóng hiểu được nội dung trên một website có
                    thực sự tốt cho người dùng của họ hay không. Với các website làm tốt, bộ máy tìm kiếm sẽ đưa lên các
                    vị trí xếp hạng cao trên trang tìm kiếm để giới thiệu tới người dùng của họ. Và đây chính là mục
                    tiêu cao nhất của những người làm công việc SEO website.<br></h3></div>
            <div id="HEADLINE303" class='ladi-element'><h3 class='ladi-headline ladi-transition'>Nếu doanh nghiệp đã làm
                    Onpage hoặc có đội content rồi thì có hình thức nào kết hợp giữa 2 bên không?<br></h3></div>
